PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `league_season_scrape_module` (
  `id` INTEGER PRIMARY KEY,
  `league_season_id` INTEGER,
  `module_name` varchar(64),
  `source_url` varchar(512),
  `is_active` BOOLEAN);
CREATE TABLE `team` (
  `id` INTEGER PRIMARY KEY,
  `franchise_id` INTEGER ,
  `code` varchar(3)   ,
  `name` varchar(64)  ,
  `city` varchar(30) ,
  `nickname` varchar(64)  ,
  `alternate_nickname` varchar(64)  ,
  `nbacom_code` char(3)  ,
  `cbssports_code` varchar(16)  ,
  `statsnbacom_team_id` INTEGER  ,
  `espn_team_id` INTEGER  ,
  `league_season_id` INTEGER  
);
CREATE TABLE league (id integer primary key, name varchar(50), slug varchar(50));
CREATE TABLE `season` (
  `id` INTEGER PRIMARY KEY,
  `name` varchar(50) NOT NULL,
  `slug` varchar(50) NOT NULL
  );
CREATE TABLE `league_season` (
  `id` INTEGER PRIMARY KEY,
  `league_id` INTEGER,
  `season_id` INTEGER,
  `rule_set_id` INTEGER,
  `is_current` BOOLEAN,
  `status` BOOLEAN
);
CREATE TABLE `game` (
  `id` INTEGER PRIMARY KEY,
  `away_team_id` INTEGER  ,
  `home_team_id` INTEGER  ,
  `date_played` date ,
  `espn_game_id` INTEGER  ,
  `cbssports_game_id` varchar(64)  ,
  `nbacom_game_id` varchar(15)  ,
  `statsnbacom_game_id` varchar(16)  ,
  `gametime` varchar(20)  ,
  `national_tv` varchar(20)  ,
  `permalink` varchar(128)  ,
  `should_fetch_data` BOOLEAN,
  `league_season_id` INTEGER  
);
COMMIT;
